import { Button, TableCell, TableRow } from "@mui/material";
import { Edit, Delete } from "@mui/icons-material";

export default function TablesClientRow(props) {

    const consultClick = {
        onClick: () => props.handleClickRow(props.idPersona),
        sx:{ cursor: 'pointer' }
    }

    return (
        <TableRow hover
            tabIndex={-1}
            >
            <TableCell align='left' key={"idPersona"} {...consultClick}> {props.idPersona}</TableCell>
            <TableCell align='left' key={"nombre"} {...consultClick}> {props.nombre}</TableCell>
            <TableCell align='left' key={"apellido"} {...consultClick}> {props.apellido}</TableCell>
            <TableCell align='left' key={"numdoc"} {...consultClick}> {props.numeroDocumento}</TableCell>
            <TableCell align='left' key={"tipoDoc"} {...consultClick}> {props.tipoDoc}</TableCell>
            <TableCell align='left' key={"fechaNac"} {...consultClick}> {props.fechaNac}</TableCell>
            <TableCell align='left' key={"editButton"} > <Button variant='contained' onClick={props.handleEditClick} ><Edit/></Button></TableCell>
            <TableCell align='left' key={"deleteButton"} > <Button variant='contained' onClick={props.handleDeleteClick} color='error'><Delete/></Button></TableCell>
        </TableRow>
    )
}
